import React from 'react';
import {useNavigate } from 'react-router-dom';


function List(props) {
	const navigate=useNavigate();
	const handleLogout=()=>{
		localStorage.clear();
		navigate('/login');
	}
  return (
  <>
  <div className="container list">
   <h1 className="text-dark text-center">Signup users</h1>
   <table class=" container table table-bordered border-primary w-50">
   <tr>
   <th class="bg-danger">Email</th>
   <th class="bg-danger">Password</th>
   </tr>
   <tr>
   <td>{props.email}</td>
   <td>{props.password}</td>
   </tr>
   </table>
   <button type="button" className="btn btn-success" onClick={()=>handleLogout}>Logout</button>

 </div>

  </>
  );
}

export default List;
